function ConvertData(data) {
    const lines = [];
  
    // Split the data by line breaks
    if (data) {
      const dataEntries = data.split('\n');
  
      dataEntries.forEach(line => {
        // If the line is not empty, add it to the lines array
        if (line.trim()) {
          lines.push(line.trim());
        }
      });
    }
  
    return lines;
  }
  
